            function highlightFeature(e) {
                if (selectedLayer) {
                    selectedLayer.setStyle({ color: "blue" });
                }
                selectedLayer = e.target;
                selectedLayer.setStyle({ color: "red", weight: 3 });
    
                var talukName = e.target.feature.properties.name;

                // Get the centroid of the polygon
                var coordinates = e.target.feature.geometry.coordinates;
                var centroid = getCentroid(coordinates);

                var lat = centroid[1];  // Latitude
                var lng = centroid[0];  // Longitude
    
                document.getElementById('selected-taluk').textContent = talukName;
                document.getElementById('taluk-details').textContent = "You selected " + talukName + " Taluk.";
                document.getElementById('selected-taluk-info').style.display = "block";
    
                // Fetch CPI data from Flask API
                fetch('http://127.0.0.1:5000/predict', {
                    method: 'POST',
                    headers: { 'Content-Type': 'application/json' },
                    body: JSON.stringify({ latitude: lat, longitude: lng })
                })
                .then(response => response.json())
                .then(data => {
                    if (data.error) {
                        alert("Error: nthis locatio" + data.error);
                    } else {
                        L.popup()
                        .setLatLng([lat, lng])
                        .setContent(`<b>${talukName}</b><br>Crop Productivity Index (CPI): <b>${data.crop_productivity_index}</b>`)
                        .openOn(map);
                    }
                })
                .catch(error => console.error('Error:', error));
            }
    
            function getCentroid(coords) {
                var totalX = 0, totalY = 0, count = 0;
                
                coords[0][0].forEach(point => { // Loop through outer polygon (ignores holes)
                    totalX += point[0];  // Longitude
                    totalY += point[1];  // Latitude
                    count++;
                });
            
                return [totalX / count, totalY / count]; // Return [lng, lat]
            }
            
            L.geoJSON(talukBoundaries, {
                style: { color: "blue", weight: 2 },
                onEachFeature: function(feature, layer) {
                    layer.bindPopup(feature.properties.name);
                    layer.on('click', highlightFeature);
                }
            }).addTo(map);
    
            window.clearSelection = function() {
                if (selectedLayer) {
                    selectedLayer.setStyle({ color: "blue" });
                }
                document.getElementById('selected-taluk').textContent = "None";
                document.getElementById('selected-taluk-info').style.display = "none";
                map.closePopup();
            };
        });

        // Function to switch tabs
        function showTab(tabName) {
            let tabs = document.querySelectorAll(".tab-content");
            tabs.forEach(tab => tab.classList.remove("active"));

            let buttons = document.querySelectorAll(".tab-button");
            buttons.forEach(button => button.classList.remove("active"));

            document.getElementById(tabName).classList.add("active");
            document.querySelector(`[onclick="showTab('${tabName}')"]`).classList.add("active");
            if (tabName === "weather") {
                fetchWeather();
            }
        }
        function fetchWeather() {
            let city = "Kanniyakumari";
            
            fetch(`/get_weather?city=${city}`)
                .then(response => response.json())
                .then(data => {
                    if (data.error) {
                        document.getElementById("weather-data").innerHTML = `<p>${data.error}</p>`;
                    } else {
                        document.getElementById("temp").textContent = data.temperature;
                        document.getElementById("pressure").textContent = data.pressure;
                        document.getElementById("humidity").textContent = data.humidity;
                        document.getElementById("aqi").textContent = data.aqi;
                        document.getElementById("last-updated").textContent = data.last_updated;
                    }
                })
                .catch(error => console.error("Error fetching weather:", error));
        }
    </script>
